AD_COLUMN.HELP:
This flags is used to specify if this process should be compatible with the legacy parameter windows.

The legacy parameter windows could only contain one grid, so the _selection and _allRows properties of the grid were directly accessible in the handler from the params object. I.e:

JSONArray gridRows = jsonparams.getJSONArray(ApplicationConstants.ALL_ROWS_PARAM);

New process definitions should access these value like this:
JSONObject myGridItem = jsonparams.getJSONObject("myGridItemName");
JSONArray myGridSelectedRows = myGridItem.getJSONArray("_selection");

The 'Compatibility with Legacy Grids' flag should only be checked if its handler retrieves the grid values in the old way.

AD_COLUMN.DEFAULTVALUE:
@SQL=SELECT COALESCE(MAX(SeqNo),0)+10 AS DefaultValue FROM OBUIAPP_Parameter 
WHERE (OBUIAPP_Process_ID is not null and OBUIAPP_Process_ID=@OBUIAPP_Process_ID@)
or  (EM_OBKMO_Widget_Class_ID is not null and EM_OBKMO_Widget_Class_ID = @OBKMO_Widget_Class_ID@)
